import { View, Text, Image, StyleSheet } from "react-native";
import React from "react";
import Logo from "../../assets/R2.png";

const Login = () => {
    return (
        <View>
            <Image source={Logo} style={StyleSheet.logo} />
        </View>
    );
};

export default Login;
